import './App.css';

//컴포넌트를 만드는 코드영역 
class App extends Component{
  render(){
    return (
      <div className="App">
        hello world
      </div>
    );
  }
}

class Subject extends Component{
  //class 안에서는 function을 생략할 수 있다.
  render(){
    return(
      <header>
        <h1>WEB</h1>
        world wide web ! 
      </header>
    );
  }
}

export default App;
